import {
	Box,
	Button,
	Flex,
	HStack,
	Icon,
	Menu,
	MenuButton,
	MenuItem,
	MenuList,
} from '@chakra-ui/react';
import {
	HamburgerIcon,
	SunIcon,
	CalendarIcon,
	ChevronDownIcon,
} from '@chakra-ui/icons';
import { MdInbox, MdDarkMode } from 'react-icons/md';
import { useState } from 'react';

const Nav = () => {
	const [toggled, setToggled] = useState(true);

	const onClick = () => {
		setToggled(!toggled);
	};

	return (
		<Box as="header" bg="rgb(32, 35, 38)" p="1em">
			<HStack spacing="2"></HStack>
		</Box>
	);
};

export default Nav;
